import * as styleSass from '../../../styles/buttons.module.scss'

function Button(props: any) {
  const styleProps = {
    width: `${props.styles.width}`,
    height: `${props.styles.width}`,
  }
  return (
    <button styles={{ styleProps }} className={styleSass.button}>
      {props.children}
    </button>
  )
}
export default Button
